    return (
        <View style= {styles.listingContainer}>
            <Image style= {styles.image} source={require("../assets/jacket.jpg")}/>
            <AppText>Red Jocket for sale!</AppText>
            <AppText>$100</AppText>
        </View>
    );
}

const styles = StyleSheet.create({
    image: {
        width: "100%",
        height: 200
    },
    listingContainer : {

    }

})
export default ListingDetailsScreen;
